import React, { useEffect, useState, Fragment } from "react";
import BarByCompany from "../Components/BarByCompany";

const Home = () => {

  const [levels, setDict] = useState([]);
  const getDict = async () => {
    try {
      const response = await fetch("http://localhost:5000/");
      const jsonData = await response.json();
      setDict(jsonData);
    } catch (err) {
      console.error(err.message);
    }
  };

  useEffect(() => {
    getDict();
  }, []);

  console.log(levels.PANDEV);
  const levels_test = {"one":1, "two":2, "three":3, "four":4}

  return (
    <Fragment>

      <table class="table mt-5 text-center">
        <thead>
          <tr>
            <th>Description</th>
            <th>Edit</th>
            <th>Delete</th>
          </tr>
        </thead>
        <tbody>
          {Object.keys(levels_test).map((key, value) => (
            <tr>
              <td>{levels_test[key]}</td>
              <td>
                {levels_test[key]}
              </td>
              <td>
                {key}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </Fragment>

  );
};

export default Home;
